import React, { useState } from "react";
import Modal from "react-modal";
import { useNavigate } from "react-router-dom";
import Logo from "../../assets/img/Brasao_ufra.png";

Modal.setAppElement("#root");

const AdminHomePage = () => {

    const [modalIsOpen, setIsOpen] = useState(false)

    const handleOpenModal = () => {
        setIsOpen(true)
    }

    const handleCloseModal = () => {
        setIsOpen(false)
    }


   return (
    <>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <img src={Logo} width="50px" height="50px" alt="Logo da Ufra" />
          <a className="navbar-brand ms-2" href="#navbarNavAltMarkup">
            Museu de Entomologia
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div
            className="collapse navbar-collapse justify-content-end"
            id="navbarNavAltMarkup"
          >
            <div className="navbar-nav">
              <button type="button" className="btn btn-outline-light">
                Adicionar Caracter√≠sticas
              </button>
              <button type="button" className="btn btn-outline-light ms-2">
                Adicionar Inseto
              </button>
            </div>
          </div>
        </div>
      </nav>


        <Modal
            isOpen={modalIsOpen}
            onRequestClose={handleCloseModal}

        >
            <h1>Modal Escolher qual caracteristica mudar</h1>
            <button onClick={handleCloseModal} >Fechar</button>
        </Modal>

    </>
  );
};

export default AdminHomePage;
